const blogs = (props) => {

    const persons = props.persons;
    console.log(props,persons);

    return ( 
        <div className="blog-list">
            
        {persons.map((person) => (
            <div className="blog-preview" key={person.id}>
                    <h1>{person.name} with {person.age} years old</h1>
                    <p>{person.gender} livin {person.city}</p>
                    <p>Is {person.gender} native american? {person.nativeAmerican}</p>
                </div>
            ))}
        </div>
        
     );
}
 
export default blogs;
